export const EasyDifficultyPegColor = {
    red: "red",
    yellow: "yellow",
    blue: "blue",
    green: "green",
}

export const NormalDifficultyPegColor = {
    ...EasyDifficultyPegColor,
    black: "black",
    white: "white",
}

export const HardDifficultyPegColor = {
    ...NormalDifficultyPegColor,
    purple: "purple",
    orange: "orange",
}

export const NightmareDifficultyPegColor = {
    ...HardDifficultyPegColor,
    grey: "darkslategrey",
    brown: "brown",
}

export const ImpossibleDifficultyPegColor = {
    ...NightmareDifficultyPegColor,
    gold: "gold",
    silver: "silver"
}
